import React from 'react';
import './App.css';

const App = () => {
  return (
    <div className='app-wrapper'>
      <header className='header'>
        <img src='karman.jpg'></img>
      </header>
      <nav className='nav'>
        <div>
          Profile
        </div>
        <div>
          Messages
        </div>
      </nav>
      <div className='content'>
        Main content
      </div>
    </div>
  );
}
export default App;
